                                                   <tr>\r\n                                                        <td>अतिरिक्त विषय</td>\r\n                                                        <td></td>\r\n                                                        <td></td>\r\n                                                    \r\n                                                    </tr>\r\n                                    </tbody>\r\n                                                </table>\r\n                                        \r\n                                                <table class=\"personal-details\" style=\"margin-top:5px; width: 100%; border-collapse: collapse;margin-bottom:0px;\">\r\n                                                    <tr>\r\n                                                        <!-- First Column -->\r\n                                                        <td colspan=\"3\" >\r\n                                                            \r\n                                                        </td>\r\n                                        \r\n                                                        <!-- Fourth Column -->\r\n                                                        <td style=\" text-align: center;\">\r\n                                                        <img src=\"data:image/jpeg;base64,\" alt=\"Student Photo\" >\r\n                                                         \r\n                                                        </td>\r\n                                                    </tr>\r\n                                                    <tr>\r\n                                                        <!-- First Column -->\r\n                                                        <td colspan=\"3\" >\r\n                                                            महाविद्यालय / +2 विद्यालय प्रधान का हस्ताक्षर <br />\r\n                                                            <span style=\"margin-left: 80px;\"> एवं मुहर </span>\r\n                                                        </td>\r\n                                        \r\n                                                        <!-- Fourth Column -->\r\n                                                        <td style=\" text-align: center;\">\r\n                                                 \r\n                                                            परीक्षा नियंत्रक (उo माo)\r\n                                                        </td>\r\n                                                    </tr>\r\n                                                </table>\r\n                                        \r\n                                        <hr style=\"border: 1px solid black;\">\r\n                                              \r\n                                                <div class=\"instructions\">\r\n                                    <h6 style=\"text-decoration: underline;text-align:center;margin-top:0px;\">परीक्षार्थी के लिए आवश्यक निदेश</h6>\r\n                                                    <ol >\r\n                                                       <li>   प्रायोगिक परीक्षा दिनांक 10/01/2025 से 20/01/2025 तक संचालित होगी। केन्द्राधीक्षक दिनांक 10/01/2025 से 20/01/2025 तक की अवधि \r\n                                            में परीक्षार्थियों की संख्या के अनुसार तिथि एवं पाली का निर्धारण करके प्रायोगिक परीक्षा केन्द्र पर आवंटित सभी परीक्षार्थियों के प्रायोगिक विषयों की परीक्षा आयोजित करेंगें।</li>\r\n                                              <li>परीक्षार्थी अपने इस प्रवेश-पत्र में उल्लिखित प्रायोगिक परीक्षा केंद्र पर दिनांक 10/01/2025 को पूर्वाह्न 09:00 बजे अनिवार्य रूप से जाकर परीक्षा\r\n                                            केन्द्र के परिसर की सूचना पट्ट से यह जानकारी प्राप्त कर लेगें कि उनके द्वारा चयनित विषय की प्रायोगिक परीक्षा किस तिथि एवं किस\r\n                                            पाली में संचालित होगी, जिसमें उन्हें सम्मिलित होना अनिवार्य है।</li>\r\n                                              <li>परीक्षार्थी के प्रत्येक प्रायोगिक विषय की परीक्षा के लिए 08 पृष्ठों की केवल एक ही उत्तरपुस्तिका मिलेगी। अतिरिक्त उत्तरपुस्तिका नहीं दी\r\n                                            जाएगी। परीक्षार्थी उत्तरपुस्तिका लेते ही यह सुनिश्चित कर लें कि इसमें 8 पृष्ठ है एवं सही क्रम में है।</li>\r\n                                              <li>उत्तरपुस्तिका प्राप्त होते ही परीक्षार्थी अपने प्रवेश-पत्र तथा उत्तरपुस्तिका पर मुद्रित विवरणों (Details) का मिलान कर यह अवश्य सुनिश्चित\r\n                                            हो लें कि जो उत्तरपुस्तिका परीक्षक द्वारा उन्हें दी गई है, वह उन्हीं की है। भिन्न विवरणों की उत्तरपुस्तिका प्राप्त होने पर उसे तुरंत\r\n                                            परीक्षक को वापस लौटा दिया जाए।</li>\r\n                                              <li>उत्तरपुस्तिका प्राप्त होने पर परीक्षार्थी उनके आवरण पृष्ठ के पीछे अंकित &#39;&#39;परीक्षार्थियों के लिए निर्देश&#39;&#39; अवश्य पढ़ें एवं उसका अनुपालन\r\n                                            करें।</li>\r\n                                              <li>परीक्षार्थी अपनी उत्तरपुस्तिका के कवर पृष्ठ के ऊपरी बायें तथा दायें भागों में क्रमांक-(1) में अपने उत्तर देने का माध्यम अंकित करते हुए\r\n                                            क्रमांक-(2) में अपना पूर्ण हस्ताक्षर अंकित करें। इसके अलावा अन्य मुद्रित विवरणों में किसी भी प्रकार से कोई छेड़-छाड़ नहीं करें।</li>\r\n                                              <li>प्रायोगिक परीक्षा की उत्तरपुस्तिका के आवरण पृष्ठ के निचले बायें एवं दायें भागों को परीक्षार्थी द्वारा कदापि नहीं भरा जाएगा। अगर परीक्षार्थी\r\n                                            इस भाग को भरते हैं, तो परीक्षार्थी को इस विषय में परीक्षाफल रद्द किया जा सकता है। ये दोनो भाग आंतरिक/बाह्य परीक्षकों को भरने के\r\n                                            लिए दिया गया है।</li>\r\n                                              <li>उत्तरपुस्तिका के पन्नो के दोनो पृष्ठों पर तथा प्रत्येक लाइन पर लिखें एवं पृष्ठों को नष्ट न करें।</li>\r\n                                              <li>यदि रफ कार्य करने की आवश्यकता हो, तो परीक्षार्थी उत्तरपुस्तिका के अंतिम पृष्ठ पर रफ कार्य करके उसे काट दे/क्रॉस (X) कर दें।</li>\r\n                                              <li>उत्तरपुस्तिका के आं‍तरिक पृष्ठों पर दाहिने हाशिए में लाइन खींचकर सादा स्थान छोड़ रखा गया है। शेष स्थान रूल्ड है।\r\n                                            परीक्षार्थी दाहिने हाशिए के सादे स्थान में कुछ भी नहीं लिखेंगें, चूँकि यह भाग परीक्षक के उपयोग के लिए है।</li>\r\n                                              <li>उत्तरपुस्तिका के पृष्ठों को मोड़ें-फाड़ें नहीं तथा बीच-बीच में व्यर्थ ही खाली न छोड़े।</li>\r\n                                                                \r\n                                              <li>प्रश्न-पत्र में दी हुई संख्या के अनुसार अपने उत्तरों की संख्या लिखें।</li>\r\n                                              <li>व्हाइटनर, ब्लेड तथा नाखून का इस्तेमाल करना सर्वथा वर्जित है, अन्यथा परीक्षाफल अमान्य कर दिया जाएगा।</li>\r\n                                              <li>प्रश्नोत्तर के समाप्त होने पर अंतिम में नीचे एक क्षैतिज रेखा खींच दें।</li>\r\n                                                <li>आंतरिक परीक्षक द्वारा उपलब्ध कराये गए उपस्थिति-पत्रक में परीक्षार्थी द्वारा यथा-स्तम्भ परीक्षा की तिथि अंकित करते हुए\r\n                                            उत्तरपुस्तिका की क्रम संख्या लिखकर अपना हस्ताक्षर किया जाएगा। परीक्षार्थी की उपस्थिति, अनुपस्थित एवं निष्कासन से संबंधित संगत\r\n                                            गोले को नीले/काले पेन से परीक्षक द्वारा भरा जाएगा न कि परीक्षार्थी द्वारा।</li>\r\n                                            \t  <li>परीक्षार्थी अपनी उत्तरपुस्तिका को आंतरिक परीक्षक के पास जमा किये बिना परीक्षा भवन न छोड़ें।</li>\r\n                                            \t    <li>परीक्षा केन्द्र में कैलकुलेटर, मोबाइल फोन, इयर फोन, पेजर, ब्लूटूथ या इस प्रकार का कोई अन्य इलेक्ट्रॉनिक उपकरण ले जाना\r\n                                            \r\n                                                    सख्त मना है।</li>\r\n                                            \t\t  <li>जॉंच परीक्षा में गैर-उत्प्रेक्षित या जॉंच परीक्षा में अनुपस्थित छात्र/छात्रा इन्टरमीडिएट वार्षिक प्रयोगिक परीक्षा, 2025 में कदापि\r\n                                            सम्मिलित नहीं हो सकते हैं।</li>\r\n                                                    </ol>\r\n                                                </div>\r\n                                        \r\n                                               <hr style=\"border: 1px solid black;\">\r\n\r\n                                            </div>\r\n\r\n                                            </body>\r\n                                            </html>\r\n                    ",
